import React, { Component } from "react";
import "../App.css";
class Test extends Component {
  state = {
    count: 12,
  };
  render() {
    return (
      <div>
        <h1 className="test">
          Hello <span>{this.state.count}</span>World!
        </h1>
        <button className="btn btn-primary m-5 ">zero</button>
      </div>
    );
  }
}

export default Test;
